x01 = (BuildOctet X0 X0 X0 X0 X0 X0 X0 X1)
x0000 = (BuildHalf x00 x00)
halfU (BuildBlock o1 o2 o3 o4) = (BuildHalf o1 o2)
halfL (BuildBlock o1 o2 o3 o4) = (BuildHalf o3 o4)
